import React from "react";

const ButtonSelector = props => {
    console.log("I'm receiving props: ", props);

    return( 
       props.buttonType === "small" ? (
           <SmallButton buttonText={props.text} />
       ) : (
           <BigButton buttonText={props.text} />
       )
    );
}

const SmallButton = props => {
    console.log("LLAMANDO SMALLBTN");
    return(
        <button className="small-button">{props.buttonText}</button>
    );
}

const BigButton = props => {
    return(
        <button className="big-button">{props.buttonText}</button>
    );
}

export default ButtonSelector;
